          <h1>Navbar examples</h1>
          <p>This example is a quick exercise to illustrate how the navbar and its contents work. Some navbars extend the width of the viewport, others are confined within a <code style="color: rgb(235, 153, 194) !important;">.container</code>. For positioning of navbars, checkout the <a href="/docs/5.0/examples/navbar-static/" style="--link-color: rgb(100, 172, 232) !important; --link-color-hover: rgb(126, 187, 236) !important; --link-color-active: rgb(100, 172, 232) !important; --visited-color: rgb(148, 100, 232) !important; --visited-color-hover: rgb(166, 126, 236) !important; --visited-color-active: rgb(148, 100, 232) !important;">top</a> and <a href="/docs/5.0/examples/navbar-fixed/" style="--link-color: rgb(100, 172, 232) !important; --link-color-hover: rgb(126, 187, 236) !important; --link-color-active: rgb(100, 172, 232) !important; --visited-color: rgb(148, 100, 232) !important; --visited-color-hover: rgb(166, 126, 236) !important; --visited-color-active: rgb(148, 100, 232) !important;">fixed top</a> examples.</p>
